import React, { Component } from "react";
import "../index.css";
class BBMSHOME extends Component {
    constructor(props){
        super(props)
        this.state={
            donors: []

        }
        this.welcome = this.welcome.bind(this);
    }
    welcome(){
        this.props.history.push('/welcome');
    }
    render() {
        return (
            <div>
                <h1><button className="btn btn-primary" onClick={this.welcome}>____WELCOME TO BBMS____</button></h1>
            </div>
        )
    }

}
export default BBMSHOME
